"     James R Jett, MD",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?1/5/1114/contributors\">",
"     Brian Kavanagh, MD, MPH",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?1/5/1114/contributors\">",
"     Joseph S Friedberg, MD",
"    </a>",
"    <br/>",
"   </div>",
