var title_f1_5_1118="Response criteria AML";
var content_f1_5_1118=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F60024&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F60024&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Response criteria in acute myeloid leukemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Category",
"      </td>",
"      <td class=\"subtitle1\">",
"       Definition",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Complete remission (CR)*",
"      </td>",
"      <td>",
"       Bone marrow blasts &lt;5 percent; absence of blasts with Auer rods; absence of extramedullary disease; absolute neutrophil count &gt;1.0 x 10",
"       <sup>",
"        9",
"       </sup>",
"       /L (1000/&micro;L); platelet count &gt;100 x 10",
"       <sup>",
"        9",
"       </sup>",
"       /L (100,000/&micro;L); independence of red cell transfusions",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       CR with incomplete recovery (CRi)&bull;",
"      </td>",
"      <td>",
"       All CR criteria except for residual neutropenia (&lt;1.0 x 10",
"       <sup>",
"        9",
"       </sup>",
"       /L (1000/&micro;L)) or thrombocytopenia (&lt;100 x 10",
"       <sup>",
"        9",
"       </sup>",
"       /L (100,000/&micro;L))",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Morphologic leukemia-free state&Delta;",
"      </td>",
"      <td>",
"       Bone marrow blasts &lt;5 percent; absence of blasts with Auer rods; absence of extramedullary disease; no hematologic recovery required",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Partial remission (PR)",
"      </td>",
"      <td>",
"       Relevant in the setting of phase I and II clinical trials only; all hematologic criteria of CR; decrease of bone marrow blast percentage to 5 to 25 percent; and decrease of pretreatment bone marrow blast percentage by at least 50 percent",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Cytogenetic CR (CRc)&loz;",
"      </td>",
"      <td>",
"       Reversion to a normal karyotype at the time of morphologic CR (or CRi) in cases with an abnormal karyotype at the time of diagnosis; based on the evaluation of 20 metaphase cells from bone marrow",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Molecular CR (CRm)&sect;",
"      </td>",
"      <td>",
"       No standard definition; depends on molecular target",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Treatment failure",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Resistant disease (RD)",
"      </td>",
"      <td>",
"       Failure to achieve CR or CRi (general practice; phase II/III trials), or failure to achieve CR, CRi or PR (phase I trials); only includes patients surviving &ge;7 days following completion of initial treatment, with evidence of persistent leukemia by blood and/or bone marrow examination",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Death in aplasia",
"      </td>",
"      <td>",
"       Deaths occurring &ge;7 days following completion of initial treatment while cytopenic; with an aplastic or hypoplastic bone marrow obtained within 7 days of death, without evidence of persistent leukemia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Death from indeterminate cause",
"      </td>",
"      <td>",
"       Deaths occurring before completion of therapy, or &lt;7 days following its completion; or deaths occurring &ge;7 days following completion of initial therapy with no blasts in the blood, but no bone marrow examination available",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
"       Relapse&yen;",
"      </td>",
"      <td>",
"       Bone marrow blasts &ge;5 percent; or reappearance of blasts in the blood; or development of extramedullary disease",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Definitions of response criteria are based primarily on those given by Cheson et al",
"    <sup>",
"     [2]",
"    </sup>",
"    .",
"    <div class=\"footnotes\">",
"     * All criteria need to be fulfilled; marrow evaluation should be based on a count of 200 nucleated cells in an aspirate with spicules; if ambiguous, consider repeat exam after 5 to 7 days; flow cytometric evaluation may help to distinguish between persistent leukemia and regenerating normal marrow; a marrow biopsy should be performed in cases of dry tap, or if no spicules are obtained; no minimum duration of response required.",
"     <br>",
"      &bull; The criterion of CRi is of value in protocols using intensified induction or double induction strategies, in which hematologic recovery is not awaited, but intensive therapy will be continued. In such protocols, CR may even not be achieved in the course of the entire treatment plan. In these instances, the overall remission rate should include CR and CRi patients. Some patients may not achieve complete hematologic recovery upon longer observation times.",
"      <br>",
"       &Delta; This category may be useful in the clinical development of novel agents within phase I clinical trials, in which a transient morphologic leukemia-free state may be achieved at the time of early response assessment.",
"       <br>",
"        &loz; Four studies showed that failure to convert to a normal karyotype at the time of CR predicts inferior outcome.",
"        <sup>",
"         [3-6]",
"        </sup>",
"        <br>",
"         &sect; As an example, in CBF AML low-level PCR-positivity can be detected in patients even in long-term remission. Normalizing to 10",
"         <sup>",
"          4",
"         </sup>",
"         copies of ABL1 in accordance with standardized criteria, transcript levels below 10 to 12 copies appear to be predictive for long-term remission.",
"         <sup>",
"          [7-9]",
"         </sup>",
"         <br>",
"          &yen; In cases with low blast percentages (5 to 10 percent), a repeat marrow should be performed to confirm relapse. Appearance of new dysplastic changes should be closely monitored for emerging relapse. In a patient who has been recently treated, dysplasia or a transient increase in blasts may reflect a chemotherapy effect and recovery of hematopoiesis. Cytogenetics should be tested to distinguish true relapse from therapy-related MDS/AML.",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     1. This research was originally published in Blood. Dohner, H, Estey, EH, Amadori, S, et al. Diagnosis and management of acute myeloid leukemia in adults: recommendations from an international expert panel on behalf of the European LeukemiaNet. Blood 2009. Copyright &copy; American Society of Hematology.",
"     <br>",
"      2. Cheson, BD, Bennett, JM, Kopecky, KJ, et al. Revised recommendations of the International Working Group for diagnosis, standardization of response criteria, treatment outcomes, and reporting standards for therapeutic trials in acute myeloid leukemia. J Clin Oncol 2003; 21:4642.",
"      <br>",
"       3. Freireich, EJ, Cork, A, Stass, SA, et al. Cytogenetics for detection of minimal residual disease in acute myeloblastic leukemia. Leukemia 1992; 6:500.",
"       <br>",
"        4. Grimwade, D, Walker, H, Oliver, F, et al. What happens subsequently in AML when cytogenetic abnormalities persist at bone marrow harvest? Results of the 10th UK MRC AML trial. Bone Marrow Transplant 1997; 19:1117.",
"        <br>",
"         5. Marcucci, G, Mr&oacute;zek, K, Ruppert, AS, et al. Abnormal cytogenetics at date of morphologic complete remission predicts short overall and disease-free survival, and higher relapse rate in adult acute myeloid leukemia: results from Cancer and Leukemia Group B study 8461. J Clin Oncol 2004; 22:2410.",
"         <br>",
"          6. Balleisen, S, Kuendgen, A, Hildebrandt, B, et al. Prognostic relevance of achieving cytogenetic remission in patients with acute myelogenous leukemia or high-risk myelodysplastic syndrome following induction chemotherapy. Leuk Res 2009; 33:1189.",
"          <br>",
"           7. Freeman, SD, Jovanovic, JV, Grimwade, D. Development of minimal residual disease-directed therapy in acute myeloid leukemia. Semin Oncol 2008; 35:388.",
"           <br>",
"            8. Perea, G, Lasa, A, Avent&iacute;n, A, et al. Prognostic value of minimal residual disease (MRD) in acute myeloid leukemia (AML) with favorable cytogenetics [t(8;21) and inv(16)]. Leukemia 2006; 20:87.",
"            <br>",
"             9. Martinelli, G, Rondoni, M, Buonamici, S, et al. Molecular monitoring to identify a threshold of CBF&beta;/MYH11 transcript below which continuous complete remission of acute myeloid leukemia inv(16) is likely [letter]. Haematologica 2004; 89:495.",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
